import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Wait for cart items and update quantity
    await page.waitForSelector('.cart-item', { timeout: 5000 });

    // Get initial quantity
    const initialQuantity = await page.textContent('.cart-item:first-child .quantity');

    // Increase quantity by clicking the + button
    await page.click('.cart-item:first-child .quantity-btn:last-child');

    // Wait for quantity update and verify
    await page.waitForFunction(
      (initialQty) => {
        const currentQty = document.querySelector('.cart-item:first-child .quantity')?.textContent;
        return currentQty && parseInt(currentQty) > parseInt(initialQty);
      },
      initialQuantity,
      { timeout: 5000 }
    );

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Extract updated quantity for verification
    const updatedQuantity = await page.textContent('.cart-item:first-child .quantity');
    const itemTitle = await page.textContent('.cart-item:first-child .cart-item-title');

    return {
      success: true,
      action: "Updated cart item quantity from " + initialQuantity + " to " + updatedQuantity,
      extractedData: {
        item: itemTitle,
        initialQuantity: initialQuantity,
        updatedQuantity: updatedQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
